const tfMachineImgEmpty = 'data:image/png;base64,';
const tfMachineImgDoorClose = 'data:image/png;base64,';
const tfMachineImgDoorCloseFront = 'data:image/png;base64,';
const tfMachineImgDoorOpenLayerBack = 'data:image/png;base64,';
const tfMachineImgDoorOpenLayerFront = 'data:image/png;base64,';
