const tfMachineImgShaking = 'data:image/png;base64,';
const tfMachineImgDoorOpenAniLayerBack = 'data:image/gif;base64,';
const tfMachineImgDoorOpenAniLayerFront = 'data:image/gif;base64,';
const tfMachineImgMachineWorkingLayerBack = 'data:image/gif;base64,';
const tfMachineImgMachineWorkingLayerFront = 'data:image/gif;base64,';

function tfMachineGenerateTFedUser(user) {
  const tempImgData = 'data:image/png;base64,';
  let tfedUser = $(`<div class="tfedUser"><p>${user}</p><img src="${tempImgData}" /></div>`);
  return tfedUser;
}


async function tfMachineStart(user) {
  // reset state
  let tfMachineImgBack = $("#tfMachineLayerBack");
  let tfMachineImgFront = $("#tfMachineLayerFront");
  tfMachineImgBack[0].src = tfMachineImgDoorClose;
  tfMachineImgFront[0].src = tfMachineImgEmpty;

  // fetch user profile pic
  let imgUrl = await getTwitchProfilePictureURL(twitchEventAuthToken, user);

  let tfMachineInput = $("#tfMachineInput");
  let userDiv = $(`<div class="tfUser"><p>${user}</p><img src="${imgUrl}" /></div>`);

  tfMachineInput.append(userDiv);
  async function doOpen() {
    tfMachineOpen(user);
  }
  tfMachineInput.fadeIn(800, doOpen);
}

